pragma solidity <=0.7.0;
//   256 
contract WorldSkills {
    struct User {//
        address adr;//solidity 
        string name;// 
        string homeadr;// 
        string role;//
    }
    struct Admin {// 
        address adr;//solidity 
        string name;// 
        string homeadr;// 
        string role;//
        bool main;//   
    }
    struct Worker {//
        address adr;//solidity 
        string name;// 
        string homeadr;// 
        string role;//
        string id;//Id 
    }
    struct Place {// 
        string name;
        uint32 index;
        address payable placeadr;
    }
    struct Mail {// 
        string trek;// 
        address payable mailsender;// solidity  
        address payable mailreceiver;//solidity  
        string mailtype;//  
        uint class;// 
        uint time;//  
        uint deliverycost;//  
        uint weight;//  
        uint decvalue;//  
        uint fullcost;// 
        string sendadr;//   
        string recadr;//  
        uint finishweight;
        bool paid; // 
        bool delivered;// 
        bool finished;// 
        bool weightdiff;//      
        bool DeliveredLate;
    }
    struct Transfer {// 
        address payable sender;// solidity  
        address payable receiver;//solidity  
        uint sum;// 
        uint time;//    
    }
    struct Transit {//      
        string worker;//     
        string trek;
        uint weight;
        uint index;//   
    }
    User[] users;
    Admin[] admins;
    Worker[] workers;
    Place[] places;
    Mail[] mails;
    Transfer[] transfers;
    Transit[] transitpoints;
    uint public globalMailCount = 0;
    uint MailCount = 0;
    address MainAdmin = msg.sender; //   
    address defaultAdr = 0x0000000000000000000000000000000000000000;//  
    mapping (address => uint) RoleCheck; //      
    mapping (address => string) WorkAdrToName;//       
    mapping (string => uint) TimeToDeliver;//        
    mapping (string => uint) TimetoReceive;//        
    mapping (string => uint) MailDestination; //  
    mapping (string => uint) TrekToId;
    mapping (uint => uint) TransferLifeTime;
    mapping (uint => Mail[]) Mails;
    mapping (string => address payable) AddressToPay;
    mapping (uint => address payable) MailIndexToAddress;
    constructor () public {
        mails.push(Mail("22", 0x0000000000000000000000000000000000000000, 0x0000000000000000000000000000000000000000, "22", 22, 22, 2, 2, 2,2, "2", "2",0,false,false,false,false,false));

